aWLIOfferedLifeOrDisabilityCoverage.Description:
{\rtf1\ansi\ansicpg1252\deff0\deflang1036{\fonttbl{\f0\fnil MS Sans Serif;}}
{\colortbl ;\red0\green0\blue0;}
\viewkind4\uc1\pard\cf1\f0\fs16 Critical Illness Insurance is an excellent complement to traditional disability income coverage. The coverage can help you meet regular month-to-month expenses as well as pay for additional costs associated with your illness, such as co-pays, prescription drugs, major medical deductibles, travel and childcare expenses. The plan provides a lump-sum benefit, payable upon diagnosis of a covered condition. Coverage is not only available to you, but also to your spouse and dependent children.\par
}

aWLIGBPModelIndividualProduct.Description:
{\rtf1\ansi\ansicpg1252\deff0\deflang1036{\fonttbl{\f0\fnil MS Sans Serif;}}
{\colortbl ;\red0\green0\blue0;}
\viewkind4\uc1\pard\cf1\f0\fs16 Group Term Life insurance is a foundation of insurance protection for employees and their families. It provides protection for a specific period of time and pays a benefit only if the insured dies during the term. There is no cash value buildup in a term life insurance policy. Group Term Life insurance provides a base level of protection that can be enhanced by personal savings, individual life insurance and Social Security benefits. The death benefit is paid income tax free to the beneficiary.\par
}
